import React from 'react';
import './MenuBar.css';
import MenuBarItem from './MenuBarItem'

function MenuBar() {
  return (
    <div className="Bar">
      <div className="Left">
        <div className="Logo">
          <p>JTK</p>
        </div>
        <MenuBarItem label="Home"/>
        <MenuBarItem />
      </div>
      <div className="Right">
        <MenuBarItem />
        <MenuBarItem />
      </div>
    </div>
  );
}

export default MenuBar;
